import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import Sdata from "./Sdata";
import "./index.css";

ReactDOM.render(
  <>
    <h1 className="heading_style">Top 5 Netflix shows</h1>

    <Card
      imgsrc={Sdata[0].imgsrc}
      link={Sdata[0].title}
      sname={Sdata[0].sname}
      title={Sdata[0].link}
    />

    <Card
      imgsrc={Sdata[1].imgsrc}
      link={Sdata[1].title}
      sname={Sdata[1].sname}
      title={Sdata[1].link}
    />
    <Card
      imgsrc="https://www.91-cdn.com/hub/wp-content/uploads/2021/09/Kota-factory-season-2-how-to-watch.jpg"
      link="https://www.netflix.com/in/title/81249783"
      sname="KOTA FACTORY"
      title="A Netflix Original Series"
    />
    <Card
      imgsrc="https://wallpaperaccess.com/full/712595.jpg"
      link="https://www.netflix.com/in/title/80018294"
      sname="DAREDEVIL"
      title="A Netflix Original Series"
    />
    <Card
      imgsrc="https://wallpapercave.com/wp/wp5954433.jpg"
      link="https://www.netflix.com/in/title/80192098"
      sname="MONEY HEIST"
      title="A Netflix Original Series"
    />
    <Card
      imgsrc="https://w0.peakpx.com/wallpaper/410/437/HD-wallpaper-narcos-armas-series.jpg"
      link="https://www.netflix.com/in/title/80025172"
      sname="NARCOS"
      title="A Netflix Original Series"
    />
  </>,
  document.getElementById("root")
);
